$(document).ready(function() {
    function loadImages(sources, callback) {
        var images = {};
        var loadedImages = 0;
        var numImages = 0;
        // get num of sources
        for (var src in sources) {
            numImages++;
        }
        for (var src in sources) {
            images[src] = new Image();
            images[src].onload = function() {
                if (++loadedImages >= numImages) {
                    callback(images);
                }
            };
            images[src].src = sources[src];
        }
    }
    var canvas = document.getElementById('front_page');
    // var canvas = document.getElementById('front_page');
    var context = canvas.getContext('2d');

    var sources = {
        sketch: "data:image/png;base64,"
    };

    loadImages(sources, function(images) {
        context.drawImage(images.sketch, 0, 0, 1000, 400);
    });


    window.requestAnimationFrame = function() {
        return window.requestAnimationFrame ||
            window.webkitRequestAnimationFrame ||
            window.mozRequestAnimationFrame ||
            window.msRequestAnimationFrame ||
            window.oRequestAnimationFrame ||
            function(f) {
                window.setTimeout(f, 1e3 / 60);
            }
    }();

    var canvas = document.querySelector('canvas');
    var ctx = canvas.getContext('2d');

    var W = canvas.width;
    var H = canvas.height;

    var vx = 0;

    var img = new Image();
    img.src = 'http://illustratedmaps.info/wp-content/uploads/2013/05/palermo-panoramic-drawing.jpg';

    (function renderGame() {
        window.requestAnimationFrame(renderGame);

        ctx.clearRect(0, 0, W, H);

        ctx.fillStyle = '#333';
        ctx.fillRect(0, 0, W, H);

        ctx.drawImage(img, vx, 50);
        ctx.drawImage(img, img.width - Math.abs(vx), 50);

        if (Math.abs(vx) > img.width) {
            vx = 0;
        }

        vx -= 2;
    }());

});